import Slider from "react-slick";
import Head from 'next/head'
import img from '../roy.jpg'
export default function Home() {
  const settings = {
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 3,
    speed: 500,
  };
  return (
    <div className = "cont">
      <Head>
        <>
        <link rel="stylesheet" type="text/css" charSet="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
        <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" />
        <link rel="stylesheet" type="text/css" href="http://kenwheeler.github.io/slick/slick/slick-theme.css"/>
        </>
      </Head>
     <h3>Meet our Teachers</h3>
     <p>Expert teachers from top universities will guide you in all your academic needs</p>
      <Slider {...settings}>
        <div>
        <img className = 'img' src={img} />
          <h3>Roy</h3>
          <h2>B.Tech, IIT</h2>
          <p>Spainish</p>
        </div>
        <div>
        <img className = 'img' src={img} />
          <h3>Adarsh Bhalotia</h3>
          <h2>MCA, NIT</h2>
          <p>Spainish</p>
        </div>
        <div>
        <img className = 'img' src={img} />
          <h3>Abid hussain</h3>
          <h2>B.Tech, MIT</h2>
          <p>Spainish</p>
        </div>
        <div>
        <img className = 'img' src={img} />
          <h3> Abdul </h3>
          <h2>M.Tech, IIT</h2>
          <p>Spainish</p>
        </div>
        <div>
        <img className = 'img' src={img} />
          <h3>Anil Janghir</h3>
          <h2>B.Tech, IIT</h2>
          <p>Spainish</p>
        </div>
      </Slider>

      <style jsx>{`
        .container {
          min-height: 100vh;
          padding: 0 0.5rem;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
        }
        .cont{
            text-align : center;
            padding: 150px;
        }
        .img{
            width : 50%;
            height : 50%;
            display : inherit;
            border-radius : 50%;
        }
        
      `}</style>

      <style jsx global>{`
        html,
        body {
          padding: 0;
          margin: 0;
          font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
            Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
            sans-serif;
        }

        * {
          box-sizing: border-box;
        }
        .slick-prev:before, .slick-next:before{
            color: red;
        }
      `}</style>
    </div>
  )
}
